(function($){$(".edd-ajax-search-search").each(function(){$(this).autocomplete({delay:250,minLength:parseInt(edd_ajax_search.minimum_characters),source:function(request,response){var form_serialized=$(this.element).closest('#edd-ajax-search-form').serialize();$.ajax({url:edd_ajax_search.ajax_url+'?action=edd_ajax_search&nonce='+edd_ajax_search.nonce,type:'GET',dataType:'json',data:form_serialized,error:function(){response()},success:function(data){response(data)}})},select:function(event,ui){if(ui.item.link!==undefined){window.location.href=ui.item.link}}}).autocomplete('instance')._renderItem=function(ul,item){$(ul).addClass('edd-ajax-search-autocomplete');return $("<li>").append(item.html).appendTo(ul)}})})(jQuery)